const List = (props) => {
  const doneList = (id) => {
    const doneTodoList = lists.map((list) => {
      if (list.id === id) {
        todo.isDone = !list.isDone;
        return list;
      } else {
        return list;
      }
      setLists(doneTodoList);
    });
  };

  return (
    <div>
      <div>{props.list.title}</div>
      <div>{props.list.todo}</div>
      <button
        onClick={() => {
          console.log("삭제");
          props.delete(props.list.id);
        }}
      >
        삭제하기
      </button>
      <button onClick={doneList}>완료</button>
    </div>
  );
};

export default List;
